                  </div>
                )}
                
                <div className="detail-row">
                  <span className="detail-label">
                    <i className="fas fa-shield-alt"></i> Role:
                  </span>
                  <span className="detail-value">{auth?.role || 'Doctor'}</span>
                </div>
                
                <div className="detail-row">
                  <span className="detail-label">
